import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import SignIn from "./Routes/SignIn";
import SignUp from "./Routes/SignUp";

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" component={SignUp} />

        <Route path="/sign-in">
          <SignIn />
        </Route>
        <Route path="/sign-up">
          <SignUp />
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
